import React from 'react';
import SockJsClient from 'react-stomp';

function App() {


    function send(message){
        console.log(message);
    }


    return (
        <div>
            <SockJsClient url='http://localhost:8080/ws' topics={['/topics/all']}
            onMessage={send}
            onConnect={()=>console.log("connected")}
             />
            <button onClick={send}>Ok</button>
        </div>
    );
}

export default App;
